import React, {Component} from 'react';
import './list.css';

class List extends Component {

  constructor(props) {
    super(props);
    this.state = {
      itemList: []
    }
    tempMask = {img: 'Img', price: '1000', name: 'temp'};
  }

  render() {
    return (
      <div className = 'main-board'>
        {this.state.itemList}
      </div>
    );
  }
}

export default List
